import apiService from '../Services/ApiService';

export async function forgotPass(email) {
    try {
        const response = await apiService.post('/forgot_password', {
            email: email,
        }, {
            headers: {
                'Content-Type': 'application/ld+json'
            }
        });

        return response.data;
    } catch (error) {
        console.error(error);
    }
}
